import React from 'react';
import Select from 'react-select';
import { country } from './menus/options'; // Import the 'country' variable from options.js
import './DropdownStyles.css';

const OriginDropdown = ({ onSelectOrigin }) => { // Removed 'options' prop since 'country' is directly imported
    return (
        <div className="dropdown-container">
            <label className="dropdown-label">Select Origin</label>
            <Select options={country} onChange={onSelectOrigin} /> {/* Use 'country' directly */}
        </div>
    );
};

export default OriginDropdown;
